import React, { useRef, useEffect } from 'react';
import './main.scss';
import Logo from './logo.png';

const Main = props => {
    return <>
        <div id="main">
            <div id="head">
                <div id="presentation">
                    <img src={Logo} width="100px" /> <br />
                    <h1>Societatea Română de Științe Informatice</h1>
                </div>
                <div id="navbar">
                    <Link className="Navitem" to="/about">About</Link>
                    <Link className="Navitem" to="/articles">Articles</Link>
                    <Link className="Navitem" to="/resources">Resources</Link>
                    <a className="Navitem" href="https://twitter.com/warewaanai" style={{color: "#48aae6"}}>Twitter</a>
                </div>
            </div>
        </div>
    </>;
}

export default Main;
